css:
.editor-colors {
  background-color: #2b2b2b;
  color: #e6e1dc;
}
.editor .markup.underline.link.hyperlink {
  text-decoration: underline;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #444444;
}
.editor .gutter {
  background-color: #232323;
}
.editor .gutter .line-number.cursor-line {
  color: #ffffff;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number::after {
  background-color: #161616;
}
.editor .gutter .line-number.cursor-line-no-selection {
  background-color: #1e1e1e;
}
.editor .gutter .fold-marker::after {
  background-color: #161616;
}
.editor .scroll-view .overlayer .cursor {
  border-color: #e6e1dc;
}
.editor .scroll-view .underlayer .wrap-guide {
  background-color: #444444;
}
.editor .scroll-view .underlayer .selection .region {
  background-color: #5a647d;
}
.bracket-matcher {
  background-color: #121212;
  opacity: 0.25;
}
.comment {
  color: #bc9458;
}
.entity,
.tag {
  color: #e96154;
}
.keyword,
.storage.type {
  color: #cc7833;
}
.constant {
  color: #91b4ce;
}
.constant.numeric,
.constant.boolean {
  color: #a5c261;
}
.variable {
  color: #d0d0ff;
}
.delimiter,
.brace {
  color: #e6e1dc;
}
.delimiter.period {
  color: #c4d798;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #773311;
}
.invalid.illegal {
  color: #773311;
}
.string,
.gfm.underline.link {
  color: #a5c261;
}
.string .constant.character.escape {
  color: #91b4ce;
}
.string.regexp {
  color: #fda428;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #773311;
}
.function,
.gfm.heading {
  color: #e8bf6a;
}
.function.punctuation {
  color: #e6e1dc;
}
.function .punctuation.definition.parameters {
  color: #cc7833;
}
.property-name {
  color: #b4ccde;
}
.editor.is-focused.vim-mode.command-mode:not(.mini) .cursor,
.editor.is-focused.vim-mode.command-mode:not(.mini) .cursor.blink-off {
  border: 0;
  background-color: #e6e1dc;
  visibility: visible;
  opacity: 0.5;
}
.editor.is-focused.vim-mode.command-mode:not(.mini) .cursor.blink-off {
  opacity: 0;
}
.editor.is-focused.vim-mode.command-mode:not(.mini) .line.cursor-line {
  background-color: #232323;
  opacity: 0.95;
}
.html .meta.tag.any {
  color: #e8bf6a;
}
.html .meta.tag.any .punctuation.definition.tag {
  color: #e8bf6a;
}
.html .meta.tag.any .entity.name.tag {
  color: #e8bf6a;
}
.haml .punctuation.definition.tag {
  color: #fda428;
}
.haml .entity.name.tag {
  color: #e8bf6a;
}
.haml .entity.name.tag.class {
  color: #e96154;
}
.haml .entity.name.tag.id {
  color: #e96154;
}
.haml .source.embedded .entity.name.tag {
  color: #cc7833;
}
.css .entity.name.tag {
  color: #e8bf6a;
}
.css .support.type.property-name {
  color: #91b4ce;
}
.css .keyword.other {
  color: #fda428;
}
.css .keyword.other.unit {
  color: #a5c261;
}
.scss .entity.attribute-name.placeholder {
  color: #e8bf6a;
}
.scss .entity.attribute-name.placeholder .punctuation.definition.entity {
  color: #cc7833;
}
.scss .meta.attribute-selector {
  color: #e8bf6a;
}
.scss .meta.attribute-selector .punctuation {
  color: #e8bf6a;
}
.scss .meta.attribute-selector .entity.attribute-name {
  color: #e96154;
}
.scss .meta.attribute-selector .string .punctuation {
  color: #a5c261;
}
.sass .meta.variable-declaration,
.sass .meta.property-value {
  color: #e6e1dc;
}
.sass .meta.variable-declaration .punctuation.definition.entity,
.sass .meta.property-value .punctuation.definition.entity {
  color: #d0d0ff;
}
.sass .meta.variable-declaration .keyword.other.unit,
.sass .meta.property-value .keyword.other.unit {
  color: #a5c261;
}
.sass .meta.property-name {
  color: #e6e1dc;
}
.sass .meta.property-name .support.type.property-name {
  color: #91b4ce;
}
.gfm.raw {
  color: #e8bf6a;
}
.erb .punctuation.section.embedded {
  color: #cc7833;
}
